import React, { useState, useEffect } from 'react';
import axios from 'axios';
import statesDistricts from './statesDistricts.json'; // Import the JSON file
import campaigns from './campaigns'; // Import the campaigns list

const App = () => {
  const [formData, setFormData] = useState({
    month: '',
    state: '',
    district: '',
    village: '',
    block: '',
    campaign: '', // Added campaign to formData
  });

  const [states, setStates] = useState([]);
  const [districts, setDistricts] = useState([]);

  const months = [
    'January',
    'February',
    'March',
    'April',
    'May',
    'June',
    'July',
    'August',
    'September',
    'October',
    'November',
    'December',
  ];

  // Populate states from JSON
  useEffect(() => {
    const uniqueStates = [...new Set(statesDistricts.map((item) => item.STATE))];
    setStates(uniqueStates);
  }, []);

  // Handle state selection and filter districts
  const handleStateChange = (e) => {
    const selectedState = e.target.value;
    setFormData({ ...formData, state: selectedState, district: '' });

    const filteredDistricts = statesDistricts
      .filter((item) => item.STATE === selectedState)
      .map((item) => item.DISTRICT);
    setDistricts(filteredDistricts);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.put('http://localhost:8001/update', formData);
      alert(response.data.message);
      setFormData({
        month: '',
        state: '',
        district: '',
        village: '',
        block: '',
        campaign: '', // Reset campaign
      }); // Reset form
      setDistricts([]); // Reset districts dropdown
    } catch (error) {
      console.error('Error updating the data:', error);
      alert('Failed to update the data.');
    }
  };

  return (
    <div>
      <h1>Service Campaign Form</h1>
      <form onSubmit={handleSubmit}>
        {/* Month Dropdown */}
        <label htmlFor="month">Month</label>
        <select
          id="month"
          name="month"
          value={formData.month}
          onChange={handleChange}
          required
        >
          <option value="">Select a month</option>
          {months.map((month, index) => (
            <option key={index} value={month}>
              {month}
            </option>
          ))}
        </select>

        {/* State Dropdown */}
        <label htmlFor="state">State</label>
        <select
          id="state"
          name="state"
          value={formData.state}
          onChange={handleStateChange}
          required
        >
          <option value="">Select a state</option>
          {states.map((state, index) => (
            <option key={index} value={state}>
              {state}
            </option>
          ))}
        </select>

        {/* District Dropdown */}
        <label htmlFor="district">District</label>
        <select
          id="district"
          name="district"
          value={formData.district}
          onChange={handleChange}
          required
          disabled={!formData.state} // Disable until state is selected
        >
          <option value="">Select a district</option>
          {districts.map((district, index) => (
            <option key={index} value={district}>
              {district}
            </option>
          ))}
        </select>

        {/* Campaign Dropdown */}
        <label htmlFor="campaign">Campaign</label>
        <select
          id="campaign"
          name="campaign"
          value={formData.campaign}
          onChange={handleChange}
          required
        >
          <option value="">Select a campaign</option>
          {campaigns.map((campaign) => (
            <option key={campaign.id} value={campaign.name}>
              {campaign.id}. {campaign.name} {/* Adding count before name */}
            </option>
          ))}
        </select>

        {/* Village Input */}
        <label htmlFor="village">Village</label>
        <input
          type="text"
          id="village"
          name="village"
          value={formData.village}
          onChange={handleChange}
          required
        />

        {/* Block Input */}
        <label htmlFor="block">Block</label>
        <input
          type="text"
          id="block"
          name="block"
          value={formData.block}
          onChange={handleChange}
          required
        />

        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default App;
